export default {
  "title": "BetaCast",
  "tagline": "Tudo sobre Nada",
  "url": "https://betacastbeta.github.io",
  "baseUrl": "/site/",
  "onBrokenLinks": "throw",
  "favicon": "img/favicon.png",
  "organizationName": "betacastbeta",
  "projectName": "site",
  "themeConfig": {
    "announcementBar": {
      "id": "supportus-new",
      "content": "<span style=\"font-weight:bold;font-family:Rubik, sans-serif;\"><a href=\"https://blmbr.carrd.co/\" target=\"_blank\">VIDAS NEGRAS IMPORTAM / BLACK LIVES MATTER</a> ✊ | 30-10-2020 #4 <a href=\"/site/arquivo/4-loucura-pt\">[pt] LOUCURA. Muita queimada para pouco bombeiro.</a> / <a href=\"/site/archive/4-madness-en\">[en] MADNESS. Too much fires for too few firefighters.</a><span>",
      "backgroundColor": "#000",
      "textColor": "#fff"
    },
    "navbar": {
      "title": "βCast",
      "logo": {
        "alt": "logo",
        "src": "img/logo-top.png"
      },
      "items": [
        {
          "label": "Lista What's App",
          "href": "https://whats.link/betacast1",
          "position": "left"
        },
        {
          "label": "Instagram",
          "href": "https://www.instagram.com/betacastbeta/",
          "position": "left"
        },
        {
          "label": "YouTube",
          "href": "https://www.youtube.com/channel/UCQ70im76p8hYpCIC_ea3N6w/",
          "position": "left"
        },
        {
          "label": "Twitter",
          "href": "https://twitter.com/cast_beta",
          "position": "left"
        },
        {
          "label": "Medium",
          "href": "https://medium.com/@betacastbeta",
          "position": "left"
        },
        {
          "href": "https://github.com/betacastbeta/site",
          "position": "left",
          "label": "Github"
        },
        {
          "to": "hello",
          "activeBasePath": "docs/",
          "label": "Passado/Past",
          "position": "left"
        },
        {
          "to": "about",
          "activeBasePath": "docs/about/",
          "label": "Sobre/About",
          "position": "right"
        }
      ],
      "hideOnScroll": false
    },
    "footer": {
      "style": "dark",
      "links": [
        {
          "title": "Links",
          "items": [
            {
              "label": "Lista Whats App",
              "href": "https://whats.link/betacast1"
            },
            {
              "label": "Instagram",
              "href": "https://www.instagram.com/betacastbeta/"
            },
            {
              "label": "YouTube",
              "href": "https://www.youtube.com/channel/UCQ70im76p8hYpCIC_ea3N6w/"
            },
            {
              "label": "Twitter",
              "href": "https://twitter.com/cast_beta"
            },
            {
              "label": "Medium",
              "href": "https://medium.com/@betacastbeta"
            },
            {
              "label": "Github",
              "href": "https://github.com/betacastbeta/site"
            },
            {
              "to": "hello",
              "activeBasePath": "docs/",
              "label": "Passado/Past"
            }
          ]
        },
        {
          "title": "Contato/Contact",
          "items": [
            {
              "label": "betacastbeta@gmail.com",
              "href": "mailto:betacastbeta@gmail.com"
            }
          ]
        },
        {
          "title": "Sobre/About",
          "items": [
            {
              "to": "/about",
              "activeBasePath": "docs/",
              "label": "Aqui! Here!"
            }
          ]
        }
      ],
      "copyright": "Orgulhosamente construído com Docusaurus / Proudly built with Docusaurus"
    },
    "prism": {
      "theme": {
        "plain": {
          "color": "#F8F8F2",
          "backgroundColor": "#282A36"
        },
        "styles": [
          {
            "types": [
              "prolog",
              "constant",
              "builtin"
            ],
            "style": {
              "color": "rgb(189, 147, 249)"
            }
          },
          {
            "types": [
              "inserted",
              "function"
            ],
            "style": {
              "color": "rgb(80, 250, 123)"
            }
          },
          {
            "types": [
              "deleted"
            ],
            "style": {
              "color": "rgb(255, 85, 85)"
            }
          },
          {
            "types": [
              "changed"
            ],
            "style": {
              "color": "rgb(255, 184, 108)"
            }
          },
          {
            "types": [
              "punctuation",
              "symbol"
            ],
            "style": {
              "color": "rgb(248, 248, 242)"
            }
          },
          {
            "types": [
              "string",
              "char",
              "tag",
              "selector"
            ],
            "style": {
              "color": "rgb(255, 121, 198)"
            }
          },
          {
            "types": [
              "keyword",
              "variable"
            ],
            "style": {
              "color": "rgb(189, 147, 249)",
              "fontStyle": "italic"
            }
          },
          {
            "types": [
              "comment"
            ],
            "style": {
              "color": "rgb(98, 114, 164)"
            }
          },
          {
            "types": [
              "attr-name"
            ],
            "style": {
              "color": "rgb(241, 250, 140)"
            }
          }
        ]
      }
    },
    "colorMode": {
      "defaultMode": "light",
      "disableSwitch": false,
      "respectPrefersColorScheme": false,
      "switchConfig": {
        "darkIcon": "🌜",
        "darkIconStyle": {},
        "lightIcon": "🌞",
        "lightIconStyle": {}
      }
    }
  },
  "plugins": [
    [
      "/app/node_modules/docusaurus-lunr-search/src/index.js",
      {
        "languages": [
          "pt"
        ]
      }
    ]
  ],
  "themes": [
    "@docusaurus/theme-live-codeblock"
  ],
  "presets": [
    [
      "@docusaurus/preset-classic",
      {
        "docs": {
          "path": "docs",
          "routeBasePath": "/",
          "sidebarPath": "/app/sidebars.js",
          "showLastUpdateTime": true,
          "showLastUpdateAuthor": true,
          "editUrl": "https://github.com/betacastbeta/site/docusaurus/edit/master/"
        },
        "blog": {
          "showReadingTime": true,
          "editUrl": "https://github.com/facebook/docusaurus/edit/master/website/blog/"
        },
        "theme": {
          "customCss": "/app/src/css/custom.css"
        }
      }
    ]
  ],
  "onDuplicateRoutes": "warn",
  "customFields": {}
};
